C3:
Date seed oil, extracted from date pits. Its low extraction rate and lack of other distinguishing characteristics make it an unlikely candidate for major use.
Dika oil, from Irvingia gabonensis seeds, native to West Africa. Used to make margarine, soap and pharmaceuticals, where is it being examined as a tablet lubricant. Largely underdeveloped.
False flax oil made of the seeds of Camelina sativa. One of the earliest oil crops, dating back to the 6th millennium B.C. Produced in modern times in Central and Eastern Europe;

C2:
The term is named after Édouard Roche (, ), who was the French astronomer who first calculated this theoretical limit in 1848.
Explanation 
The Roche limit typically applies to a satellite's disintegrating due to tidal forces induced by its primary, the body around which it orbits. Parts of the satellite that are closer to the primary are attracted more strongly by gravity from the primary than parts that are farther away;
